script: |
  super -f text -I q8103.spq | sort > q8103.out

inputs:
  - name: q8103.spq
    data: |
      SELECT DISTINCT col0 * - col0 + + cor0.col1 / col1 + - cor0.col2 AS col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT + col0 * + cor0.col2 = - col1 / + col1;
  - name: tab2

outputs:
  - name: q8103.out
    data: |
      -6109
      -6278
      -75
